.cc1 {
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
  height: 100vh;
  width: 100vw;
}
h1 {
  font-size: 64px;
  font-weight: bold;
 color: #ffffff;
  position: relative;
  z-index: 10;
}
h2 {
  font-size: 56px;
  font-weight: bold
}
h3 {
  font-size: 30px;
  font-weight: bold;
}
h4 {
  color: var(--primary);
  text-transform: uppercase;
  letter-spacing: 4px;
  font-size: 24px;
  font-weight: 500
}
.box1 {
  border-radius: 99px;
  background: linear-gradient(180deg, #040608 0%, #09483A 100%);
  padding: 12px;
  margin-top: 34px;
  margin-bottom: 18px;
  position: relative;
}
.box1::before {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  border-radius: 99px;
  border: 2px solid transparent;
  background: linear-gradient(180deg, rgba(80, 63, 58, 0.1) 0%, #0A997B 100%) border-box;
  -webkit-mask: linear-gradient(#fff 0 0) padding-box, linear-gradient(#fff 0 0);
  -webkit-mask-composite: destination-out;
  mask-composite: exclude;
}
.box2 {
  border-radius: 20px;
  background: linear-gradient(180deg, #040608 0%, #09483A 100%);
  padding: 40px;
  margin-top: 34px;
  margin-bottom: 18px;
  position: relative;
  display: flex;
  column-gap: 40px;
}
.box2::before {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  border-radius: 20px;
  border: 2px solid transparent;
  background: linear-gradient(180deg, rgba(80, 63, 58, 0.1) 0%, #0A997B 100%) border-box;
  -webkit-mask: linear-gradient(#fff 0 0) padding-box, linear-gradient(#fff 0 0);
  -webkit-mask-composite: destination-out;
  mask-composite: exclude;
}
.box2 .box1 {
  margin-top: 0px;
  margin-bottom: 0px;
  text-align: center;
  position: relative;
  z-index: 10;
}
.box2 .w-50 {
  text-align: left;
  position: relative;
  z-index: 10
}
footer {
  display: flex;
  justify-content: space-between;
  align-items: center;
  font-size: 16px;
  padding-top: 72px;
}
footer hr {
  background: var(--primary);
  height: 2px;
  opacity: 1;
  margin: 10px 0px;
}
footer .date {}
footer .signature {}
footer .signature IMG {
  margin-bottom: -20px;
}
footer.withdraw {
  padding-top: 24px;
  padding-left: 40px;
  padding-right: 40px;
}
@media (max-width:991px) {
  .bg2 {
    background-size: 70% 50%, 90% 50%;
  }
}
@media (min-width:991px) {}
@media (max-width:768px) {
    
    .bg1 {  background-size: 100%;}
  h1 {
    font-size: 32px;
  }
  h2 {
    font-size: 30px;
  }
  h4 {
    letter-spacing: 0px;
    font-size: 20px;
  }
  .box1 {
    padding: 12px 24px;
  }
  .box2 {
    display: block;
      padding-bottom: 20px;
      padding: 40px 20px 20px 20px;
  }
  .box2 .w-50 {
    width: 100% !important;
    margin-bottom: 32px;
  }
  footer {
    padding-top: 48px;
    display: block;
  }
  footer hr {
    display: none;
  }
  footer .date {}
  footer .signature {
    margin-top: 24px;
    display: flex;
    justify-content: center;
    flex-direction: column;
    align-items: center;
  }
  .bg2 {
    background-size: 70% 50%, 90% 50%;
  }
}
